import { BrowserRouter, Routes, Route, Redirect } from 'react-router-dom';
import Login from '../src/paginas/Login.js';
import Cadastro from './paginas/Cadastro.js'

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/">
          <Redirect to="/login" />
        </Route>
        <Route path="/cadastro" element={<Cadastro />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
